		<li>支持括号把一部分括起来，再用 \1 \2 等引用前面的实现复杂查询：比如田字笔顺是25121, “*(25121)*\1*\1*”能查找含有3个田字的字; 比如查品字形的字用“(*)\1\1”

<SCRIPT>

{
	if(txt3.value.length==0)

		txt4.value="输入错误!";
		return;
	}
	var ss=txt3.value.substr(0,1);
	var re = new RegExp("`"+ss+"\-[^`-]*\-([^`]*)`","g");
	var str=strr
	mm=str.match(re)
	if(mm)
	{
		var tt=mm[0].split('-');
		txt4.value=tt[2].substr(0,tt[2].length-1);
		bh.value="*"+txt4.value+"*";

	}
}

function find_char(page,t)
{
	if(t==0)
	{

	}
